def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def generate_primes(n):
    primes = [2]
    i = 3
    while len(primes) < n:
        if is_prime(i):
            primes.append(i)
        i += 2

print("First 100 prime numbers:")
number_of_primes = 100
for p in generate_primes(number_of_primes):
    print(p, end=" ")
